v: /tabletop games can be a great way for people to find others with shared interests that aren't available on other social networks.

@ispeaknerd.eth: there will be offline /tabletop events in August in Los Angeles, San Francisco, New York, and San Diego. Also, there will be many games at /basecamp001.

@betashop.eth: our mission is to increase the GDP of Farcaster.

Every time you rate or reply to something, you're spending a part of your social capital to show others its value.

All Moxie transactions are signed when interacting with the frame.

dwr: The balance of ERC20 tokens and NFTs will be a future filter for direct messages.

